import React from 'react';
import s from "./../Dialogs.module.css";

const Message = (props) => {

    var m = s.message;

    if(props.author == 'me'){
        m = s.me;
    }else{
        m = '_other';
    }

    return (
        <div className={m}>{props.message}</div>
    );
}

export default Message;
